  \"2016-05-25T00:52:41.642905\",\n\t\"name\": \"flight-data-processing-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Flight Data Processing System (FDPS)
  performs flight data processing for flight operations and outputs flight strips
  to the appropriate sector positions. The FDPS centralizes the processing and archival
  of text oriented Air Traffic Control information at MEART facilities. The information
  falls into six categories: 1) flight plans and flight plan management; 2) checkpoint
  position from radar sources; 3) weather and Notices to Airmen (NOTAMS); 4) textual
  communications; 5) Controller to Pilot Data Link Communications; and 6) ATS Interfacility
  Data Communications (AIDC). The FDPS includes all processors, storage sub-systems,
  I channel subsystem, power subsystem, communication subsystem, multiplexers, A and
  D system consoles, and system printers. (Source: FSEP Desk Guide)\",\n\t\"license_title\":
